import React from 'react';

const TableHeader = (props) => {
  return (
    <div>
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
    </div>
  );
};

export default TableHeader;
